import React from "react"

export default function Home() {
    return (

        <div class="titleDes">
               <h2 class="sub" ><b>Oi!! Vamos viajar?</b></h2>
                <p class="h2">Planeje a melhor viagem da sua vida conosco</p><br/>
                <img src="imagens/bariloche.png" class="img-responsive pull-left " width="500px"/> <br /><img src="imagens/casal-viajando.jpg" class="img-responsive pull-left" width="500px"/>

                <br /><br /><br /><br /><br />
                <p class="h2">Pacotes de Viagens para Diversos Locais com Preços Justos. Entre em Contato Agora</p>
                <br /><br /><br /><br /><br />
                <img src="imagens/bariloche.png" alt="" />

        </div>
    );
}
